CREATE TABLE `medications` (
  `medication_id` int(11) NOT NULL AUTO_INCREMENT,
  `brand_name` varchar(100) DEFAULT NULL,
  `generic_name` varchar(100) NOT NULL,
  `category_id` int(11) DEFAULT NULL,
